import React from 'react';
import GoogleMapReact from 'google-map-react';
import { useSelector } from 'react-redux';

const GoogleMapWithoutPolygon = ({ mapConfig }) => {
    console.log('RENDER - google map WITHOUT polygons');
    const vehiclesLocations = useSelector((state) => state.map.vehiclesLocations);
    const locationMarkers = getLocationMarkers(vehiclesLocations);

    return (
      <GoogleMapReact 
        bootstrapURLKeys={{ key: process.env.REACT_APP_API_KEY }}
        defaultCenter={mapConfig.center}
        defaultZoom={mapConfig.zoom}
      >
        {locationMarkers}
      </GoogleMapReact>
      );
};

export default GoogleMapWithoutPolygon;
